import React, {Component} from 'react';
import './HomeCard.css';

class HomeCard extends Component {
    render() {
        return (
            <div className='card'>
                <div className='cardImage'>
                    <img src={this.props.card.mainPhotoUrl}/>
                </div>
                <div className='cardDetails'>
                {this.props.card.title}
                </div>
            </div>
        );
    }
}

export default HomeCard;
